import React from "react";
import { user } from "./join";
import { ToastContainer, toast } from "react-toastify";

function Chat() {

  return (
    <div>
      { toast.success("Hey Folk Welcome")}
      <h1>{user}</h1>

      <ToastContainer />
    </div>
  );
}

export default Chat;
